var judete = {
    sv: 'Suceava',
    bt: 'Botosani',
    is: 'Iasi',
    nt: 'Neamt',
    bc: 'Bacau',
    vs: 'Vaslui',
    gl: 'Galati',
    vn: 'Vrancea',
    bz: 'Buzau',
    br: 'Braila',
    ct: 'Constanta',
    tl: 'Tulcea',
    mh: 'Mehedinti',
    dj: 'Dolj',
    gj: 'Gorj',
    vl: 'Valcea',
    ot: 'Olt',
    ag: 'Arges',
    tr: 'Teleorman',
    db: 'Dambovita',
    gr: 'Giurgiu',
    il: 'Ialomita',
    cl: 'Calarasi',
    ph: 'Prahova',
    b : 'Bucuresti',
    sm: 'Satu Mare',
    mm: 'Maramures',
    bh: 'Bihor',
    ar: 'Arad',
    tm: 'Timis',
    cs: 'Caras Severin', 
    hd: 'Hunedoara', 
    ab: 'Alba',
    sb: 'Sibiu',
    bv: 'Brasov',
    cv: 'Covasna',
    hr: 'Harghita',
    ms: 'Mures',
    bn: 'Bistrita Nasaud',
    cj: 'Cluj',
    sj: 'Salaj'
};

for (var judet in ro) {
    ro[judet].color = '#c5ced8';
    
    (function (st, judet) {
        st.attr({
            'id': judet, 
            'title': judete[judet],
            'href': wikiURL + judete[judet]
        }).click(function(e){e.preventDefault()});

        st.hover(
                function(){
                    if ( !$(this[0]).attr('sel') ) st.animate({fill: st.color}, 200);
                    R.safari();
                    $(judet).css('display','block');
                },
                function(){
                    if ( !$(this[0]).attr('sel') ) st.animate({fill: "#F0F0F0"}, 200);
                    R.safari();
                }
            )
            .click(function(){
            	if (judete[judet] === 'Cluj') {
            		$("#bubble-map").fadeOut('slow');
            		$('#mapCluj').fadeIn('slow')
            					 .css('transform', 'scale(4)');
            		$('#mapClujOverlay').fadeIn('slow');
            	}
                var t = $(this[0]);
                if (t.attr('sel')) return;
                st.animate({fill:'#aad1f2'}, 100);

                $.each(ro, function(){
                    if (this != st) {
                        this.animate({fill: "#F0F0F0"}, 100);
                    }
                })

                t.attr('sel', true).parent().siblings().find('path').removeAttr('sel')
                R.safari();

            });
        
        // unde punem numele prescurtate ale judetelor
        var w = st.getBBox().width,
            h = st.getBBox().height,
            svg_l = $('#bubble-map').offset().left, 
            svg_t = $('#bubble-map').offset().top, 
            off = $(st[0]).offset(), 
            ol = off.left, 
            ot = off.top, 
            stg = ol - svg_l,  
            sus = ot - svg_t, 
            left = stg + w / 2, 
            top =  sus + h / 2;

        // we don't live in a perfect world
        if (judet == 'mh') left = left * 1.1
        if (judet == 'ct') left = left * 1.015
        if (judet == 'cj') top  = top  * 1.05
        if (judet == 'il') {top = top  * 1.02; left = left * 1.06}

        ro[judet].judete = R
                            .text( left, top, judet.toUpperCase() )
                            .attr({
                                   fill: '#47555c',
                                   font: 'bold 10px arial,helvetica,sans-serif'
                            });

    })(ro[judet], judet);
}
